import React from 'react'
import { View, ActivityIndicator } from 'react-native';

export const LoadingScreen = () => {
    return (
        <View
            style={{
                flex: 1,
                justifyContent: 'center',
                alignItems: 'center'
            }}
        > 
            <ActivityIndicator size="large" color="#0000ff" />
        </View>
    )
}
